	(1,'Our Guide to Remote Learning','our-guide-to-remote-learning','','Teachers continue to inspire us by keeping learners engaged while sofas and kitchen tables replace classroom desks and cubicles.','clat.jpg',0,0,'2020-08-20 09:16:30','2020-08-20 11:01:22'),
	(2,'The Good Trade 12','the-good-trade-12','','testing data 456','mechanical.jpg',1,0,'2020-08-20 09:22:43','2020-08-20 11:00:40'),
	(3,'Online Examination','online-examination','','For some students, taking an online exam is a new and somewhat bewildering experience. They don’t know what to expect, and aren’t certain of the skills and strategies that will enable them to perform at their best. On a good note, many of the steps they’d take to complete an online exam are quite similar to those that they’d engage in as they prepare for an in-class test; however, the online environment does present some differences that warrant a bit of extra awareness and preparation. ','b-arch.jpg',1,0,'2020-08-26 10:16:45','2020-08-26 10:16:45'),
	(4,'IIT Preparation','iit-preparation','','Over 10,00,000 students take IIT-JEE each year, but only a small percentile make it. The most essential step in cracking any competitive examination is to believe that you have it in you to realize your dream. With this perspective, as you prepare for IIT-JEE means you’ve won half the battle.','studying.jpg',1,0,'2020-08-26 10:31:24','2020-08-26 10:31:24'),
	(5,'Government Exam','government-exam','','The Directorate of Government Examinations was formed as a separate directorate in India on February 1975. Prior to the formation of Directorate Of Government Examinations, the then DPI/DSE was the ex-officio commissioner for Govt. exams and the department was having its office at Madras only. The first secondary school leaving certificate exam was conducted in the year 1911. This directorate started conducting the following major exams from the year noted against each of them in addition to the various examination.','mechanical1.jpg',1,0,'2020-08-26 10:32:27','2020-08-26 10:32:27'),
	(6,'Top Universities','top-universities','','QS World University Rankings is an annual publication of university rankings by Quacquarelli Symonds (QS). Previously known as Times Higher Education–QS World University Rankings, the publisher had collaborated with Times Higher Education (THE) magazine to publish its international league tables from 2004 to 2009 before both started to announce their own versions. QS then chose to continue using the pre-existing methodology, while THE adopted a new methodology to create their rankings.\r\n\r\nIn partnership with Elsevier, the QS system now comprises the global overall and subject rankings (which name the world\'s top universities for the study of 48 different subjects and five composite faculty areas), alongside five independent regional tables (Asia, Latin America, Emerging Europe and Central Asia, the Arab Region, and BRICS).[1]\r\n\r\nBeing the only international ranking to have received International Ranking Expert Group (IREG) approval,[2] the QS ranking is viewed as one of the three most-widely read university rankings in the world, along with Academic Ranking of World Universities and Times Higher Education World University Rankings.[3][4][5][6] According to Alexa Internet, it is the most widely viewed university ranking worldwide.[7] However, it has been criticized for its overreliance on subjective indicators and reputation surveys, which tend to fluctuate over the years.[8][9][10][11][12] Concern also exists regarding the global consistency and integrity of the data used to generate QS ranking results.[9][13][14][15]','non-tech.jpeg',1,0,'2020-08-26 10:34:01','2020-08-26 10:34:01'),
	(7,'Top civil exam','top-civil-exam','','QS World University Rankings is an annual publication of university rankings by Quacquarelli Symonds (QS). Previously known as Times Higher Education–QS World University Rankings, the publisher had collaborated with Times Higher Education (THE) magazine to publish its international league tables from 2004 to 2009 before both started to announce their own versions. QS then chose to continue using the pre-existing methodology, while THE adopted a new methodology to create their rankings.\r\n\r\nIn partnership with Elsevier, the QS system now comprises the global overall and subject rankings (which name the world\'s top universities for the study of 48 different subjects and five composite faculty areas), alongside five independent regional tables (Asia, Latin America, Emerging Europe and Central Asia, the Arab Region, and BRICS).[1]\r\n\r\nBeing the only international ranking to have received International Ranking Expert Group (IREG) approval,[2] the QS ranking is viewed as one of the three most-widely read university rankings in the world, along with Academic Ranking of World Universities and Times Higher Education World University Rankings.[3][4][5][6] According to Alexa Internet, it is the most widely viewed university ranking worldwide.[7] However, it has been criticized for its overreliance on subjective indicators and reputation surveys, which tend to fluctuate over the years.[8][9][10][11][12] Concern also exists regarding the global consistency and integrity of the data used to generate QS ranking results.[9][13][14][15]','civil-site.jpg',1,0,'2020-08-26 10:35:06','2020-09-12 14:52:32'),
	(8,'jaksdhjfjkadhf 123212','jaksdhjfjkadhf-123212','2','uuuuu','electrical.jpg',1,0,'2020-09-12 14:52:14','2020-09-12 14:52:44');
