	(2,1,'blog post','blog-post','<div xss=removed><p xss=removed><strong xss=removed>Lorem Ipsum</strong> is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p></div><div xss=removed></div>','non-tech.jpeg',0,6,NULL,NULL,NULL,NULL,'2020-08-20 12:18:25','2020-08-25 15:16:30'),
	(3,3,'Conduct & Record Online Class & Sell Your Classes','conduct-record-online-class-sell-your-classes','<p xss=removed>The coronavirus outbreak worldwide has resulted in the rise of the <span xss=removed>online class</span>/education industry. More and more educational institutions are conducting classes online to ensure continuity in education.</p><p xss=removed>This virus has somehow brought the much-needed transformation in the mode of teaching. As a response to the CoVID 19 global pandemic, not only colleges but even coaching institutes and those involved in private tuitions are using the new model to teach students online. But still, some have not embarked on this journey of <span xss=removed>online teaching.</span></p><p xss=removed>Are you a newbie for <span xss=removed>conducting online classes</span>? If you are someone who is still contemplating on <span xss=removed>how to conduct online classes</span> as well as record them, this article will help you to get some clarity.</p><div><h2 xss=removed>Before the Online Exam: Prepare</h2><ul xss=removed><li><span xss=removed>Read and understand the test guidelines.</span> Be sure you can answer these questions: Will the test take place at a specific date and time, or can you take the exam at any point during a particular window of time? How much time will you have to complete the test? Can you take the test at home, or must you take the exam in a specific location (e.g., a campus computer lab)? Are there any other important, “need to know” factors outlined by the instructor?</li><li><span xss=removed>Know the test format.</span> What kinds of questions will the instructor use on the exam—multiple-choice, fill-in, short answer, essay? Perhaps a combination of various types?</li><li><span xss=removed>Test yourself.</span> If your instructor makes a practice exam available to you, take it! You may also find practice tests in your class textbook.</li><li><span xss=removed>Check your computer.</span> Avoid last-minute problems! Whether you’re using your own computer or one in a lab, verify that it has all the correct hardware and software well in advance of the exam. Also, make sure you’ll be in a location with an adequate Internet location.</li><li><span xss=removed>Study the class materials!</span> Even if the test is “open book,” it’s still important to study and review just as if you were taking the test in a classroom.</li><li><span xss=removed>Plan your time.</span> As you test yourself, limit your time to that which will be allotted for the actual test, and decide how long you will spend on each question (e.g. if the test is one hour long, and you’ll have</li><li><span xss=removed>Carve out a quiet test-taking spot with minimal distractions.</span> Turn off all notifications from IM, your phone, your email, and elsewhere (or, set them to silent). Shut off the TV and radio. Let your roommates or family know that you’ll be taking a test, so that they’re less likely to interrupt you during that time.</li><li><span xss=removed>Determine </span><em><span xss=removed>when</span></em><span xss=removed> you will take the test.</span> You may have to take the exam at a specific time; however, if the test will be available for several hours (or even a few days), choose a time that presents the least potential for distraction, interruption, and stress.</li><li><span xss=removed>Gather all that you’ll need to take the test.</span> If you can have materials such as notes, books, or writing implements with you, be sure that they’re set to go.</li><li><span xss=removed>Take a deep breath!</span> Once you’re logged in, take a moment to relax and get focused.</li></ul><h2 xss=removed>During the Online Exam: Focus</h2><ul xss=removed><li><span xss=removed>Keep an eye on the clock.</span> You may want to set an alarm to notify you when you have limited time (e.g., 10 minutes) remaining in your testing period.</li><li><span xss=removed>If allowed by your instructor, print and save copies of the test questions, as well as your answers.</span> These will prove extremely helpful if you have technical problems during the test or if you encounter issues while submitting your answers.</li><li><span xss=removed>Don’t leave the test page!</span> If you are permitted to search the web or check other websites for information, do not use the same tab or copy of the browser as you do for your exam—you may lose all your work. Instead, open a second copy of your browser (or, choose a completely different browser), then conduct your search.</li><li><span xss=removed>Technical problems? Don’t panic.</span> But do contact your instructor immediately, detailing the exact problem that occurred and any error messages you might have received. If you can take a screen shot, that is helpful as well.</li><li><span xss=removed>Check your work before you submit it.</span> Ensure that every answer is complete and appears as you intended. Review the accuracy of your answers, as well as your spelling and grammar.</li><li><span xss=removed>Click submit.</span> You should only need to do so once, but if you have a problem, try once more. If you still have a problem submitting the test, let your instructor know immediately, and send your intended answers in an attached document.</li></ul><h2 xss=removed>After the Online Exam: Review</h2><ul xss=removed><li><span xss=removed>Assess <em>your own</em> progress.</span> How do <em>you</em> believe you did? What questions did you find confusing? Did you have to skip anything? Return to your notes and readings, and see if you can find the answers to the questions that challenged you.</li><li><span xss=removed>Check your grade.</span> In some cases, you may be able to learn your grade immediately. However, exams with written answers will take longer for your instructor to grade, so allow some time to find out your score.</li><li><span xss=removed>Ask yourself how you can improve on the next exam.</span> Did your study strategies work? Did your plan for taking the test online prove successful? Write down your observations and keep them in mind for the next time you take a test. (Watkins and Corry, 183-185)</li></ul></div>','how-to-take-online-test-or-exam.jpg',1,3,NULL,NULL,NULL,NULL,'2020-08-26 10:20:07','2020-08-26 10:20:07'),
	(4,3,'What is an Online Exam?','what-is-an-online-exam','<p xss=removed><span xss=removed>Online examination, also known as e-examination, enables examiners to conduct examinations through the internet or a company-wide intranet for remote candidates. Most </span><b xss=removed>online exam </b><span xss=removed>systems include answer processing modules, which allows evaluators to issue results as soon as candidates finish the test. This fully automated system evaluates the examinee thoroughly and presents the result in less time. Unlike traditional pen-and-paper exams, it is possible to conduct open-book exams on an online exam system. </span></p><p xss=removed><span xss=removed>In an online exam, a candidate can answer the questions in a given time, and the test window collapses once the exam is over, and evaluators keep answers ready for evaluation. The evaluator assesses responses, whether it be through an automated or manual process, and the result will be conveyed to the candidate either by mail or information available on the website. Many companies are resorting to online examination software as their preferred medium of choice for assessing professional capability and career adaptability.</span></p><h3 xss=removed><span xss=removed><b xss=removed>How are Online Exams Conducted?</b></span></h3><p xss=removed><strong xss=removed>Step 1:</strong> The users of e-assessments can be classified into three broad categories:</p><h4 xss=removed><strong xss=removed>Supervisors:</strong></h4><p xss=removed>The ones who manage the system users, the tests, system back-up, and recovery are the supervisors.</p><h4 xss=removed><strong xss=removed>Conductors:</strong></h4><p xss=removed>The ones who prepare the subjects, tests, and questions are the conductors.</p><h4 xss=removed><strong xss=removed>Test-Takers:</strong></h4><p xss=removed>The ones who sit for the assessment to get evaluated are the test-takers.</p><p xss=removed><strong xss=removed>Step 2:</strong> The testing environment is set up, and the question sets are uploaded to the environment by the test conductors.</p><p xss=removed><strong xss=removed>Step 3:</strong> The test takers are given test IDs using which they can log on and attempt the test. The tests are usually monitored automatically and can be proctored for high stakes examinations.</p><p xss=removed><strong xss=removed>Step 4:</strong> Once the user submitted the test, it is evaluated by the system/conductors depending on the types of questions.</p><p xss=removed><strong xss=removed>Step 5:</strong> Participants are sent their test scores if needed.</p><h3 xss=removed><span xss=removed><b xss=removed>How Online Examination Systems Work?</b></span></h3><p xss=removed><span xss=removed>The online examination system is a software solution that allows any institute or industry to plan, organize</span><span xss=removed>, and </span><span xss=removed>administer examinations through the internet/intranet and Local Area Network (LAN) environments. Since conducting manual examination can become a strenuous undertaking when issues are encountered, such as delay in result processing, difficulty in filing and filtering of records, and more. Besides, the possibility that extremely crucial information might get lost during recordkeeping is evident. Moreover, system maintenance is also a time consuming and resource-intensive process. On the contrary, the new-age examination system is efficient, agile, and less resource-intensive.</span></p><p xss=removed><span xss=removed>In an </span><b xss=removed>online exam</b><span xss=removed>, a teacher or examiner creates various kinds of questions (Multiple Choice Questions[MCQ] or free text questions) and adds them to the test. Then the students receive the link to the online exam with which they can sign up and take the test. Soon after, they get the exam results. Here is a step-by-step process on the working of </span><b xss=removed>online examination</b><span xss=removed>:</span></p>','scope-of-online-examination-system-in-india.png',1,5,NULL,NULL,NULL,NULL,'2020-08-26 10:23:12','2020-08-26 10:23:12'),
	(5,3,'What Are the Usual Features of an Online Exam System?','what-are-the-usual-features-of-an-online-exam-system','<p xss=removed><span xss=removed>Here’s a quick rundown on the typical features of an online exam software:</span></p><ul xss=removed><li xss=removed><span xss=removed>It can be used to create some of the most engaging tests and exams. Best of all, it will let you add images, text, video, and questions in your exam.</span></li><li xss=removed><span xss=removed>Its easy-to-use features help in creating credible tests within minutes.</span></li><li xss=removed><span xss=removed>There is no dearth of question types to pick from: multiple-choice image questions, multiple-choice</span><b xss=removed> test </b><span xss=removed>questions, </span><span xss=removed>audio-video</span><span xss=removed> questions, fill in the blanks, etc.</span></li><li xss=removed><span xss=removed>The end-user can create a comprehensive question bank with a wide variety of questions in an online exam software. Moreover, examiners can arrange problems using a randomizer to keep the test content unique and relevant.</span></li><li xss=removed><span xss=removed>It also enables end-users to use tags for their question bank. They can create new tags and assign the right tags to each question for analysis purposes.</span></li><li xss=removed><span xss=removed>Setting new pass-fail rules for exams is also possible in online exam software. There’s a lot that can be done with it. For instance, users can set the time limit and amount of attempts for each question. Moreover, candidates can be allowed to review their answers before submitting them. It is also probable that they can receive feedback after each problem or at the end; possibilities are endless.</span></li><li xss=removed><span xss=removed>Custom styling and personal branding are something that creates a strong impression in the minds of examinees. So, users can make the most of this white-labeling feature.</span></li><li xss=removed><span xss=removed>It lends a distraction-free experience to students that are utilizing the platform for taking exams. </span></li></ul><p xss=removed><span xss=removed>Learn more about </span><a href=\"https://blog.mettl.com/assessment-technology/online-exam-software-platform?hsLang=en-gb&utm_source=www.google.com&utm_medium=blog\" target=\"_blank\" rel=\"noopener\" xss=removed><span xss=removed>how to choose the right online exam software</span></a></p><h3 xss=removed><span xss=removed><b xss=removed>Who Uses an Online Examination System?</b></span></h3><p xss=removed><span xss=removed>Online examination platforms cater to the needs of various clients, such as government, corporate, institutes, colleges, among others. </span></p><h4 xss=removed><b xss=removed>Internet Revolution Comes to Education</b></h4><p xss=removed><span xss=removed>With the </span><a href=\"https://blog.mettl.com/talent-hub/technology-in-examination?hsLang=en-gb&utm_source=www.google.com&utm_medium=blog\" target=\"_blank\" rel=\"noopener\" xss=removed><span xss=removed>advent of technology</span></a><span xss=removed> as the world seems to digitize and shift everything online from food to clothes to rides, nothing remains untouched, not even education. The pervasiveness of technology like laptops, computers have made the transition to an online system easy.</span></p><p xss=removed><span xss=removed>Universities, schools, and various educational institutions have progressed and adapted to some kind of learning management system &#40;LMS&#41;, where a software application tracks, reports, administers</span><span xss=removed>, and</span><span xss=removed> documents different materials required to be given to students. This teaching and evaluation system is facilitating a balanced approach of spreading knowledge as well as ease of grading the candidates.</span></p><h3 xss=removed><span xss=removed><b xss=removed>What Is the Objective of Online Examinations?</b></span></h3><p xss=removed><em xss=removed><span xss=removed>“A report by Google & KPMG forecasts that by 2021, the market for online education will be worth $1.96 billion, which is a huge jump from $247 million in 2016.”</span></em></p><p xss=removed><span xss=removed>The online industry is growing at a fast pace. Think about it-what is making it so famous and widespread? People are not fools, who just shift to something blindly; there is always a reason. Many factors play a role; it could be the convenience, the increased reachability, and above all, the customization. Think, think again.</span></p><p xss=removed><span xss=removed>Established evaluation techniques are slowly reaching their limits. Soon they will become obsolete. The objective of online exams is to ensure that assessment setters can go with the paradigm shift from offline to online processes for education, hiring, and learning & development.</span></p><p xss=removed><span xss=removed>It has been predicted that soon technology will embrace the educational sector, leaving no space for the pen-paper. And why shouldn’t it? Considering all the advantages offered, why fear? But everyone has their fair share of apprehensions, and it is mandatory to address them. In the following section, we will be discussing the extent to which online examinations have spread in the arena of education and what are the various challenges faced by these groups.</span></p><h3 xss=removed><b xss=removed><span xss=removed>Why Do We Need Online Examination Systems?</span></b></h3><p xss=removed><span xss=removed>We all are yearning for a system that instills our faith in examinations. Quite clearly, we are losing our confidence in the current pen-paper assessments, which appears to be no longer fit. Let us look at why we need </span><a href=\"https://blog.mettl.com/assessment-technology/online-examination-system?hsLang=en-gb&utm_source=www.google.com&utm_medium=blog\" target=\"_blank\" rel=\"noopener\" xss=removed><span xss=removed>online examination systems</span></a><span xss=removed> in the coming times and what we cannot do with conventional methods.</span></p><h4 xss=removed><b xss=removed>The Entrance Exams Exertion</b></h4><p xss=removed><span xss=removed>The more sought after the university, the more applications to screen. Every year, the universities are flooded with applications for various courses; however, filtering them through written tests is a costly affair. In addition to this, a lot of effort gets consumed in shortlisting physical test facilities, added to this is the burden of making arrangements of invigilators, who are supposed to proctor far off test locations.</span></p><p xss=removed><span xss=removed>The institutes face considerable challenges in managing the logistics and financial burden that comes in a package deal with the pen & paper. Disrupting the daily college life of the students to make space for exam centers adds the cherry on top.</span></p><h4 xss=removed><b xss=removed>The Semester Setback</b></h4><p xss=removed><span xss=removed>Imagine the plight of universities during exam days; it’s not only an evaluation of the students’ learnings but also the faculty, who are expected to manage and organize the examinations successfully. Their duties include accommodating hundreds of pupils: converting gyms & auditoriums into exam halls, looking for invigilators to proctor them, checking papers for hours and days to get the result out. Revaluation is another big concern; students often dissatisfied with the checking want their papers to be rechecked, which would be nothing less than an added burden for the teachers, and the authenticity can still be a question mark for the students.</span></p><h4 xss=removed><b xss=removed>The Pre-Placement Perplexity</b></h4><p xss=removed><span xss=removed>Once students are ready to graduate from colleges, but before they do, comes the moment of placement drives, where there is an influx of companies looking to hire people. For hiring what’s required is assessments, and again, the age-old tradition of wasted time, effort, money begins.</span></p><h4 xss=removed><b xss=removed>The Reluctance</b></h4><p xss=removed><span xss=removed>We are satisfied with the old ways of life and resist change. A reluctance to change makes us question the good and find fault with the system. We do all this just to remain in our comfort zone, talking of reluctance, let’s explain the consequences with an example.</span></p><p xss=removed><span xss=removed>We all are aware of Kodak; it was a name that resonated as the world’s largest film manufacturer. Where is it now? Do the millennials even know about it? Why did it lose its spot?</span></p><p xss=removed><span xss=removed>Hit by the wave of digitalization, they weren’t agile enough to adapt to the needs and changing times, they loved their space, but then that’s not how it works. Sometimes change is difficult, but it is necessary to survive.</span></p><p xss=removed><span xss=removed>Kodak failed to keep pace with changing times and technologies. Similarly, most people in the educational sector find it difficult to change, well-adjusted with pen and paper; they fail to understand that the educational industry is reshaping and still resort to the old ways. Satisfied with the old ways of life, the idea of online assessment discomforts them. They fear technical mishaps, cost, and academic dishonesty. It is only when they try new ways that they can unshackle themselves from old ideas.</span></p><h4 xss=removed><b xss=removed>The Inadequate Auto-Grading</b></h4><p xss=removed><span xss=removed>Riding on the horses of fame, coaching institutes have converted themselves into full-grown giants in the education sector. Accredited with integrated learning programs and well-versed teachers, these training institutes have their share of miseries. Reaching out to the untapped talent beyond the geographical limitations, ensuring a wider reach of their assessments and simulators, as well as a quick evaluation of the student’s performance, is what they desire. Caught up in the spiral of inadequate auto-grading, which results in strenuous manual correction of answer sheets, they searched for cost and energy effective solutions.</span></p><h4 xss=removed><b xss=removed>The Confused Career Guidance</b></h4><p xss=removed><span xss=removed>Schools, the second home to children, is the building block of a child’s future. It is here where desires, aspirations, dreams of achieving something are shaped. Teachers play an integral part in guiding kids in what they think is the best for them, telling them the various career opportunities and what they shall pursue in the future. What they lack is a definitive way to measure the ability and personality of the children, which tells them precisely about the behavioral and cognitive competencies.</span></p><h4 xss=removed><b xss=removed>The Staff Recruitment Ruckus</b></h4><p xss=removed><span xss=removed>How do we propose to evaluate our teaching and non-teaching staff? How do we just go by our instincts and grade them? Conducting interviews to choose teachers of different subjects as well as non-teaching staff is very cumbersome. Instead, a defined approach, with some set parameters, will make recruitment easy.</span></p><h4 xss=removed><b xss=removed>Common to All</b></h4><p xss=removed><span xss=removed>Common to all, educational bodies are highly concerned about the logistics incurred due to written examinations. Indulgence of candidates in unethical activities is another point of concern they are desperate to solve. What they want is to reduce the turnaround time, which keeps adding to their cost. But the root cause always remained at the heart of the assessment process, presenting issues with security, transparency, the cost in terms of infrastructure, people, and operations.</span></p><p xss=removed><span xss=removed>The educational landscape in India has undergone quick development, and what is right now, the biggest in the world, enrolls 70 million students. Truth be told, India has created extra space for 40 million more students. That is a lot of assessments and a considerable amount of cash blown.</span></p>','Tips-Online-Exams-1110x380.jpg',1,1,NULL,NULL,NULL,NULL,'2020-08-26 10:24:23','2020-08-26 10:24:23'),
	(6,3,'What Are the Benefits of Online Examination Systems?','what-are-the-benefits-of-online-examination-systems','<h3 xss=removed><span xss=removed><b xss=removed>Reduction in Logistics:</b></span></h3><p xss=removed><span xss=removed>Online exams help to overcome the challenge of setting up physical test conducting locations. This not only helps to minimize the resources, i.e., time, cost of setting up, and the need for human proctors but also speeds up the entire process of examination. In universities, online exams accelerate the entire admission process, where applications can be screened with minimal resources. The idea of conducting semester examinations and various assessments online just makes the entire process smooth and easy to handle.</span></p><h3 xss=removed><span xss=removed><b xss=removed>Accessibility to Remote Areas:</b></span></h3><p xss=removed><span xss=removed>In an attempt to reach the untapped talent, online exams have broken the barriers of geography. With a global assessment solution training institutes, universities can conduct assessments worldwide with ease. The ability to conduct tests requiring nothing more than an internet connection means that examination can be accessible for anyone and from anywhere.</span></p><h3 xss=removed><span xss=removed><b xss=removed>Scalable:</b></span></h3><p xss=removed><span xss=removed>Online exams can cater to a broad audience and can easily manage a large amount of content. Taking this feature into account, educational institutions who suffer a paucity of time will find it very convenient to conduct examinations with the least wastage of their bandwidth. Just a computer with an active connection and sometimes a webcam to take tests makes this possible.</span></p><h3 xss=removed><span xss=removed><b xss=removed>Supports All Types of Content and Creation:</b></span></h3><p xss=removed><span xss=removed>You might wonder that online exams can be a way out, but what about the content they support. Many of you might be under the impression that online exams only support multiple-choice questions, and this is the only format that can run well on the platform. That’s where we need a correction. The question type favored by online exams range from MCQs, fill in the blanks, checkboxes to short answers, long answers ( which need to be evaluated by the teacher separately), coding simulators and business case studies. The teachers can log in to the platform with an ID and then easily create a question paper without any paper wastage. Leading companies like </span><a href=\"https://mettl.com/computer-based-tests/online-exam-software/?utm_source=www.google.com&utm_medium=blog\" target=\"_blank\" rel=\"noopener\" xss=removed><span xss=removed>Mettl</span></a><span xss=removed> provide such a platform where online assessments can be conducted along with an extensive content library to choose from. It is like a question bank, which is at the perusal of the clients, who can create their assessments.</span></p><h3 xss=removed><span xss=removed><b xss=removed>Combats Cheating:</b></span></h3><p xss=removed><span xss=removed>Cheating has been the topmost concern of any person related to the educational industry. Whenever it’s exam time, the first question thought about is how can cheating be reduced? The solution is at your doorstep.</span></p>','download.jpeg',1,2,NULL,NULL,NULL,NULL,'2020-08-26 10:26:27','2020-08-26 10:26:27'),
	(7,3,'How Can You Prevent Cheating in Online Examinations: Online Proctoring','how-can-you-prevent-cheating-in-online-examinations-online-proctoring','<p xss=removed><span xss=removed>Remote proctoring ensures a controlled environment, where the candidates are under continuous surveillance, which reduces the ability to cheat. </span><a href=\"https://blog.mettl.com/assessment-technology/web-proctored-exams-all-you-wanted-to-know?hsLang=en-gb&utm_source=www.google.com&utm_medium=blog\" target=\"_blank\" rel=\"noopener\" xss=removed><span xss=removed>Online proctored examination</span></a><span xss=removed> solves two purposes: eradicates malpractices and reduces the need for too many invigilators. The webcam keeps an eye on the candidates at all times, behavioral alerts notify the proctor of any unpleasant activity, web browsing tolerance prevents them from switching screens, and a recorded video of the same is saved for future reference.</span></p><p xss=removed><span xss=removed>Moreover, these recorded videos play an integral part in re-evaluation. In case the student is not satisfied with the way the evaluation of the assessment is conducted, he/she can request for feedback from one of the in-house experts. The expert, in turn, takes the assistance of the remotely proctored video and gives comprehensive feedback to the candidate with proper justification for the same and an evidence to show if required.</span></p><p xss=removed><span xss=removed>If the </span><a href=\"https://blog.mettl.com/online-remote-proctoring?hsLang=en-gb&utm_source=www.google.com&utm_medium=blog\" target=\"_blank\" rel=\"noopener\" xss=removed><span xss=removed>online remote proctoring</span></a><span xss=removed> feature doesn’t intrigue you enough, then perhaps an additional web browser known as Exam Safe Browser is something that you need.  Reputed companies like Mettl offer this feature, where once installed and activated for online exams, it permits the test taker to see one screen, i.e., the questions which need to be answered, shortcuts, copy-paste, opening another window everything is prohibited. Universities, schools can use this feature to maintain a highly secure environment.</span></p><h3 xss=removed><span xss=removed><b xss=removed>Auto-Graded Reports:</b></span></h3><p xss=removed><span xss=removed>The automated report serves the purpose of eliminating manual correction and saves many working hours. A report is a comprehensive approach to the candidate’s performance, which has a question wise and section-wise summary of the attempt.</span></p>','rsz_5e3d4a616af94.png',1,4,NULL,NULL,NULL,NULL,'2020-08-26 10:27:35','2020-08-26 10:27:35'),
	(8,3,'How Mercer| Mettl Can Help?','how-mercer-mettl-can-help','<p xss=removed><span xss=removed>Mercer | Mettl’s</span><a href=\"https://mettl.com/computer-based-tests/online-exam-software/?utm_source=www.google.com&utm_medium=blog\" target=\"_blank\" rel=\"noopener\" xss=removed> <b xss=removed>online examination system</b></a><span xss=removed> helps in conducting high-stakes assessments on its secure examination platform preloaded with online proctoring. The tool enables end-users to manage the end-to-end online assessment process. The entire process, from online registration, test creation to center management</span><span xss=removed>, and </span><span xss=removed>real-time reporting, is centered on assisting clients in conducting assessments with the utmost ease. </span></p><p xss=removed><span xss=removed>You may also want to read: </span><a href=\"https://blog.mettl.com/online-entrance-exam-software/?utm_source=www.google.com&utm_medium=blog\" target=\"_blank\" rel=\"noopener\" xss=removed><span xss=removed>An End-To-End Guide on Online Entrance Exams</span></a></p>','download.png',1,5,NULL,NULL,NULL,NULL,'2020-08-26 10:28:45','2020-08-26 10:28:45'),
	(9,4,'How To Prepare For IIT-JEE','how-to-prepare-for-iit-jee','<p xss=removed>JEE consists of two levels: JEE Main and JEE Advanced. Before you start preparing for IIT JEE, it is important to understand the structure of the exam.</p><p xss=removed>The JEE Main is three hours long and consists of 90 multiple-choice questions. The exam has three sections: Physics, Chemistry, and Maths. Each section has 30 questions, having equal weightage.</p><p xss=removed>The JEE Advanced is very different from the main exam. It has the same topics as the mains, but it is divided into two three-hour long papers. Each paper has three sections divided according to topics. It is considered tough as compared to JEE Main.</p><p xss=removed>IIT JEE can be a difficult exam to crack. It requires a lot of preparation and hard work. Here are some steps that will help you crack it in your first attempt:</p><p xss=removed><span xss=removed>1. Use Class XII textbooks</span> <span xss=removed>first</span><span xss=removed>:</span> NCERT books will definitely help you start the preparation, as they briefly cover most of the topics.</p><p xss=removed><span xss=removed>2. Know the topics well: </span>Even though both the exams have the same subjects, Physics, Chemistry and Maths, the topics and the level of difficulty is very different. Know what to prepare for which exam. Read the syllabus before you start preparing.</p><p xss=removed><span xss=removed>3. Don’t use too many books to prepare: </span>Select a handful of books that you can keep referring to. Too many books may confuse you. Some of the suggested books published by Pearson are given below.</p><p xss=removed><span xss=removed>4. Clear your fundamentals before starting difficult topics: </span>Knowing the basic topics will help you understand the difficult topics. You will save on a lot of time and effort. The exam tests students on their understanding of the topics.</p><p xss=removed><span xss=removed>5. Revise: </span>Once you are done with a difficult topic make sure you revise it so you can retain it better. Revision is very important.</p><p xss=removed><span xss=removed>6. Practice papers are very important: </span>Keep solving the previous year’s papers. They will help you prepare, and boost your confidence. Make sure you finish the papers in the prescribed time.</p><p xss=removed><span xss=removed>7. Manage your time:</span> Make sure you have enough time to cover all the topics. Don’t leave too many things for the last minute.</p><p xss=removed><span xss=removed>8. Plan:</span> A well planned preparation is much better than a disorganised one. Make lists, get a calendar and make sure you stick to the plan.</p>','img_9985.jpg',1,1,NULL,NULL,NULL,NULL,'2020-08-26 10:36:49','2020-08-26 10:36:49'),
	(10,4,'Pearson Learning Centre hosts Bangalore’s largest CET Strategy Session','pearson-learning-centre-hosts-bangalore-s-largest-cet-strategy-session','<p xss=removed><em xss=removed>Aims at preparing CET/JEE/AIPMT aspirants for future career planning</em><br><span xss=removed>Bangalore, 21st July, 2014: Pearson Learning Centre</span>, a part of Pearson, the world’s leading learning company hosted a <span xss=removed>‘Mega Strategy Session’</span> in Bangalore today for CET/JEE/AIPMT aspiring students. Mr. Venkat Phanikiran, an IIT Delhi alumni and a national level entrance expert led the session at which he provided counseling and guidance to the students on topics such as ‘how to fine-tune strategies’ to succeed in the entrance exams in the days ahead.</p><p xss=removed>Mr. Venkat Phanikiran also shared information on various Engineering/Medical Entrance exams in India with the students and guided them on how to balance between preparing simultaneously for Board & Entrance exams.<br>Mr. Venkat Phanikiran also shared information on various Engineering/Medical Entrance exams in India with the students and guided them on how to balance between preparing simultaneously for Board & Entrance exams.</p><p xss=removed>Strategy session shared methods and techniques which were successfully used by over thousands of students who have studied for the CET / AIEEE/ IIT-JEE at Pearson Learning Centre. The centre which is popular for teaching quick problem-solving and time-saving methods had helped students to reach their full potential.</p><p xss=removed>“The mega strategy session is an initiative that is in line with our commitment of providing world-class education solutions to our students. This is the time of the year when students start planning for their future careers and seek information on the various choices they have. We believe this session will help them gain insights from experts in the field of education and help them make informed choices,” <span xss=removed>said Vinod Viswanathan, Head – Pearson Learning Centre.</span></p>','linkedin-copy.png',0,2,NULL,NULL,NULL,NULL,'2020-08-26 10:38:18','2020-08-26 10:38:18'),
	(11,4,'How many hours should I study?','how-many-hours-should-i-study','<p class=\"q-text qu-display--block\" xss=removed><span xss=removed>Some of you out there must be toppers of your class or among the top 10% of your class. But that is just a performance in your class or best at a school level. It means till now you have been competing among a small student base of 50 – 1000 students.</span></p><p class=\"q-text qu-display--block\" xss=removed><span xss=removed>But once you start preparing for IITJEE or AIEEE entrance, the competition is huge. This year in 2015, over 2 lakh students appeared in IITJEE and over 12 lakh in AIEEE. So my advice is that you seriously need to scale up your efforts to face the competition.</span></p><p class=\"q-text qu-display--block\" xss=removed><span xss=removed>Are you ready to face these challenges?</span></p><p class=\"q-text qu-display--block\" xss=removed><span xss=removed>You need to prepare yourself mentally as well as physically to face this competition.Mentally, you need to think wide when you think of competition you are facing so don’t get defocused and remember that you have to compete with unknowns so you have to put your all efforts in it to excel.</span></p><p class=\"q-text qu-display--block\" xss=removed><span xss=removed>May you have scored well in your school level examinations by not even spending 20 hours on studies at home but this is not going to be enough with such a huge competition. You need to scale up your efforts and set a target of 50-55 hours studies at home every week and you have to do scale up step by step.</span></p><p class=\"q-text qu-display--block\" xss=removed><span xss=removed>It also true that you are not going to get start studying for 9-10 hours suddenly its require proper strategy.</span></p><ul class=\"q-box\" xss=removed><li class=\"q-relative\" xss=removed><span xss=removed>For the first week you try to cut down your times which you are spending in other works by 2 to 3 hours</span></li><li class=\"q-relative\" xss=removed><span xss=removed>Next week cut down your times which you are spending in other works again by 2 to 3 hours</span></li><li class=\"q-relative\" xss=removed><span xss=removed>You cannot start studying 1o hours a day suddenly where as earlier you are studying for 3 to 4 hours</span></li><li class=\"q-relative\" xss=removed><span xss=removed>Try to do same as earlier, Increase your study time from 3-4 to 6-7 hours and in next week or after 2 weeks scale up to 9 to 10 hours.</span></li></ul><p class=\"q-text qu-display--block\" xss=removed><span xss=removed>How you study for these hours?</span></p><p class=\"q-text qu-display--block\" xss=removed><span xss=removed>You have to study with full concentration, no disturbance, and continuously for 3 hour sessions. The idea is to simulate real exam conditions. While studying, you have to create an atmosphere as if you are sitting in exam. Avoid doing following during a 3 hours session:</span></p><ul class=\"q-box\" xss=removed><li class=\"q-relative\" xss=removed><span xss=removed>Study on a desk if you have it at home. Avoid studying while lying down on a bed.</span></li><li class=\"q-relative\" xss=removed><span xss=removed>Don’t get up from your desk during 3 hours of study session. Even not for drinking water.</span></li><li class=\"q-relative\" xss=removed><span xss=removed>Don’t listen music during studies. If you have a habit, then slowly come out of it by reducing it day by day.</span></li><li class=\"q-relative\" xss=removed><span xss=removed>No phone calls and no SMS during studies.</span></li></ul>','download_(1).png',1,3,NULL,NULL,NULL,NULL,'2020-08-26 10:42:42','2020-08-26 10:42:42'),
	(12,4,'Do\'s & Don\'ts During JEE Preparation?','do-s-don-ts-during-jee-preparation','<p class=\"q-text qu-display--block\" xss=removed><span xss=removed>You have to take out 55 hours every week and for this you need to sacrifice some of your time sucking activities.</span></p><p class=\"q-text qu-display--block\" xss=removed><span xss=removed>If you are involved in any of the following activities mentioned below, I suggest you should stop it immediately:</span></p><p class=\"q-text qu-display--block\" xss=removed><span xss=removed>Don\'t socialize too much:</span><span xss=removed>-Avoid too much talking on phone with your friends. Not more than -30 minutes every day. Keep yourself away from family discussions and don’t get into arguments with parents and brothers/sisters because it will only wastes your time and energy. Be selfish to focus on your career.</span></p><p class=\"q-text qu-display--block\" xss=removed><span xss=removed>Don\'t spend long hours on TV</span><span xss=removed>,</span><span xss=removed> Internet and playing games:-</span><span xss=removed> If you are too much into TV, cut down immediately. Don’t spend more than 1 hour in front of TV every day.</span></p><p class=\"q-text qu-display--block\" xss=removed><span xss=removed>Internet is the biggest addiction of all time. Real time sucker. Don’t sit on computer for more than 1 hour unless as their any study need.</span></p><p class=\"q-text qu-display--block\" xss=removed><span xss=removed>Don\'t play outdoor sports:-</span><span xss=removed>Those who are playing physical games a lot should reduce them. These games are very tiring. If you are physically tired, you would not be able to concentrate on studies. I suggest evening walk or light exercise either in the morning or evening.</span></p><p class=\"q-text qu-display--block\" xss=removed><span xss=removed>Don\'t study late night:-</span><span xss=removed> Those who study late nights, sleep whole day. This is a bad schedule. If you don’t sleep well in the night, you will feel sleepy in school and in your coaching classes. So best is you should sleep for 7 hours any time between 10 PM to 9 AM. Those who don’t get study atmosphere at home in the day time, in worst case they should study till 2.00 AM and get up at 9.00 AM.</span></p><p class=\"q-text qu-display--block\" xss=removed><span xss=removed>Don\'t sleep for long or two short sleep hours:-</span><span xss=removed>You should target for 7 hours sleep every day. Also avoid day time sleeping for more than 90 minutes.Those you could manage to sleep less, I would not recommend a sleep of less than 5-6 hours. If body is tired, mind cannot function properly.</span></p><p class=\"q-text qu-display--block\" xss=removed><span xss=removed>Don\'ts go to school daily:</span><span xss=removed>-I suggest that if possible, go to school not more than 4 times a week. School studies are not going to play important role in your career at this stage. Even school studies should be done just before the exams say 1-2 weeks before exams.</span></p><p class=\"q-text qu-display--block\" xss=removed>HOPE YOU WILL FOLLOW THIS.........</p>','main-qimg-c6d04ffcf53c29e54167b53b969d6a85.jpeg',1,3,NULL,NULL,NULL,NULL,'2020-08-26 10:43:46','2020-08-26 10:43:46'),
	(13,4,'JEE Exam day Guidelines','jee-exam-day-guidelines','<div class=\"q-box\" xss=removed><div class=\"q-text\" xss=removed><span class=\"q-box qu-userSelect--text\" xss=removed><p class=\"q-text qu-display--block\" xss=removed><span xss=removed>How to attempt a JEE paper?</span></p><ul class=\"q-box\" xss=removed><li class=\"q-relative\" xss=removed>First you decide about subject which you find easy</li><li class=\"q-relative\" xss=removed>Then you should attempt it first with speed and accuracy and after it second and next</li><li class=\"q-relative\" xss=removed>Don\'t stick to one question and give to much time to it. Better you leave it and proceed further ,their are many question.</li><li class=\"q-relative\" xss=removed>Try to attempt all questions which you find easy in first look in the whole paper</li><li class=\"q-relative\" xss=removed>After that again go to starting point and see questions which can you solve by giving some time in whole paper</li><li class=\"q-relative\" xss=removed>Now after doing all these thing and if you have time left then try to solve question by eliminating options</li><li class=\"q-relative\" xss=removed>Don\'t do blind guessing. If you are 50% SURE then you may guess it</li></ul><p class=\"q-text qu-display--block\" xss=removed><span xss=removed>Solution to some of the problems/thoughts that can come during the exam:</span></p><ul class=\"q-box\" xss=removed><li class=\"q-relative\" xss=removed>You going to be nervous so try to understand that this problem is happening with everyone so don\'t try to think why i am getting nervous</li><li class=\"q-relative\" xss=removed>Try to take deep and long breath for 2 to 3 minutes when you feel frustrated and nervous during your exam.</li><li class=\"q-relative\" xss=removed>When you not able to solve few question then try to think that if you are not able to solve these question then others are also not able to solve these question (try to believe on your potential)</li><li class=\"q-relative\" xss=removed>Try to keep aside your ego during exam (Sometimes there are few question which you think why am I not able to solve these question and end up spending lot of time on it. Instead leave that question and move ahead)</li></ul><p class=\"q-text qu-display--block\" xss=removed><span xss=removed>Few things you should do in between BREAK of two hours</span></p><ul class=\"q-box\" xss=removed><li class=\"q-relative\" xss=removed>Don\'t try to analyse first paper of JEE advanced and also try not to think about it</li><li class=\"q-relative\" xss=removed>Try to escape away from other students and also not discuss anythings with them about papers its only create problems..</li><li class=\"q-relative\" xss=removed>Try to find a park near your school and try to do lunch their and listen light music..</li><li class=\"q-relative\" xss=removed>Try to be calm and drink juice or water .</li></ul><p class=\"q-text qu-display--block\" xss=removed>FOLLOW THESE THINGS IT HELP YOU</p><div>    <br></div></span></div></div>','2013826-63129386-6671-image-1.jpg',1,5,NULL,NULL,NULL,NULL,'2020-08-27 07:50:25','2020-08-27 07:50:25'),
	(14,4,'Which Coaching Institute I Should Join For iit ?','which-coaching-institute-i-should-join-for-iit','<p class=\"q-text qu-display--block\" xss=removed>In this I will try to tell you about which coaching you should join</p><p class=\"q-text qu-display--block\" xss=removed>As I studied from Vidyamandir classes and information which i get from friends after analyzing all I come to a decision.</p><p class=\"q-text qu-display--block\" xss=removed>I am going to tell about overall assesstment of vidyamandir classes..</p><p class=\"q-text qu-display--block\" xss=removed><span xss=removed>I WANT to share you some facts about vidyamandir classes</span></p><ul class=\"q-box\" xss=removed><li class=\"q-relative\" xss=removed>IN other coaching there are 4 to 5 day classes in a week due to which you\'re most of time spent in attending coaching classes.</li><li class=\"q-relative\" xss=removed>Now you think how you do self study,which is an important part to gain concept</li><li class=\"q-relative\" xss=removed>You are in intense pressure while in VMC there are 2 TO 3 classes in regular batch and 2 classes in Extreme batch so you get enough time to self study and clear your theory classes without any stress.</li><li class=\"q-relative\" xss=removed>In<span xss=removed> </span>vidyamandir you will not only taught the respective subject,but they taught you a way of living and some useful things which going to change your life as whole.</li><li class=\"q-relative\" xss=removed>As far as the teaching is concerned, it is the best you could get.</li><li class=\"q-relative\" xss=removed>All the Bhaiyas (you are adviced to call teachers Bhaiya not sir) are great</li><li class=\"q-relative\" xss=removed>You will instantly feel the difference between these guys and other teachers.</li><li class=\"q-relative\" xss=removed>get enough time to self study and clear your theory classes without any stress.</li></ul><p class=\"q-text qu-display--block\" xss=removed><span xss=removed>Now Why Vidyamadir classes have best study material.</span></p><ul class=\"q-box\" xss=removed><li class=\"q-relative\" xss=removed>Vidyamadir has provided the study material properly made and framed according to the current level of IIT. It\'s not too high like fiitjee and nor too low</li><li class=\"q-relative\" xss=removed>Vidyamadir has taken out problem from 1000 of books and created 100 of problems with their R&D Team hence framing best thing.</li><li class=\"q-relative\" xss=removed>Vidyamadir material has huge no of problems and its very difficult to complete the package.hence if you are able to solve whole package series you will be confident about your concept and hence no need for books</li><li class=\"q-relative\" xss=removed>The best thing in VMC is that vmc try to provide all sorts of material and try to put all types of important question in his material so you not need to solve other books</li><li class=\"q-relative\" xss=removed>Finally vidyamandir has the best material, solve it and score well</li></ul><p class=\"q-text qu-display--block\" xss=removed>The methodology of VMC teachers remains the same irrespective of the centre</p><p class=\"q-text qu-display--block\" xss=removed><span xss=removed>Note:-</span>In one survey of IIT Delhi students who join IIT (from institutes other than VMC) are not interested in the study more in IIT because of the stress they get during your preparation</p><p class=\"q-text qu-display--block\" xss=removed>Show you can decide now you want to study by keeping pressure on you or by doing a study as study.    </p>','Prepare-for-IIT-JEE-in-one-year2.png',0,2,NULL,NULL,NULL,NULL,'2020-08-27 07:52:10','2020-08-27 07:52:10'),
	(15,4,'What are Common Preparation Mistakes of iit?','what-are-common-preparation-mistakes-of-iit','<div class=\"q-text\" xss=removed><span class=\"q-box qu-userSelect--text\" xss=removed><p class=\"q-text qu-display--block\" xss=removed>I made a lot of mistakes in class 11th, which I later caught up with in class 12th. So, the mistakes mentioned below were made by me primarily in 11th standard<br></p><ul class=\"q-box\" xss=removed><li class=\"q-relative\" xss=removed>Ignored NCERT textbooks and stayed miles away from them thinking that NCERT textbooks are for noobs</li><li class=\"q-relative\" xss=removed>Forgot that I myself was a noob (became overconfident)</li><li class=\"q-relative\" xss=removed>Wasted a lot of time in playing cricket</li><li class=\"q-relative\" xss=removed>Wasted a lot of time on Facebook and other social networking sites</li><li class=\"q-relative\" xss=removed>Wasted a lot of time in playing GTA games (San Andreas and Vice City)</li><li class=\"q-relative\" xss=removed>Ignored Inorganic Chemistry and got swayed away with the beauty of Maths and Physics</li><li class=\"q-relative\" xss=removed>Solved less number of problems</li><li class=\"q-relative\" xss=removed>Read less of theory in Physics and Maths</li><li class=\"q-relative\" xss=removed>Solved less problems in Chemistry</li><li class=\"q-relative\" xss=removed>Spent less time in understanding general organic chemistry (GOC)</li><li class=\"q-relative\" xss=removed>Relied on coaching teachers for learning</li><li class=\"q-relative\" xss=removed>Didn\'t take tests seriously - never did so called \"forward analysis\" (analyzing the mistakes committed in an exam)</li><li class=\"q-relative\" xss=removed>Didn\'t really read/solve problems from book and relied on coaching notes</li><li class=\"q-relative\" xss=removed>Ignored subjective problems in Maths</li><li class=\"q-relative\" xss=removed>Used calculator to while solving problems of Physical Chemistry</li><li class=\"q-relative\" xss=removed>Read too less theory in Waves and Sounds (Physics)</li><li class=\"q-relative\" xss=removed>Read too less theory in Thermodynamics (Chemistry)</li></ul><p class=\"q-text qu-display--block\" xss=removed><br>Some people have mentioned about not making a schedule/timetable. Well, I too didn\'t follow any specific timetable. However, I feel that not following a timetable isn\'t a mistake. Timetables look good only in theory. They are hard to realize in practice and it is absolutely fine if you are unable to follow a timetable.</p><div><br></div></span></div>','download_(2).png',0,3,NULL,NULL,NULL,NULL,'2020-08-27 07:57:34','2020-08-27 07:57:34'),
	(16,5,'Know the Exam','know-the-exam','<p xss=removed>Every exam is different and before you start the preparation for any exam, the one thing of utmost importance is knowing about the exam. Depending on which exam you are planning to give, make sure you are thorough with the exam details and its syllabus. Knowing the exam will provide you a pathway which you must follow in order to crack the exam. The things that you must know about the exam are:</p><ol xss=removed><li xss=removed>Syllabus of the exam</li><li xss=removed>Eligibility criteria for the exam</li><li xss=removed>The job position that you are applying for and the department it falls under.</li><li xss=removed>Job responsibilities</li><li xss=removed>The knowledge and any special expertise required for the exam.</li><li xss=removed>Future Prospects, mainly for college exams.</li></ol><p xss=removed>These are some of the details that you must have about the exam and if you are wondering where you will be able to find it then we have you covered.</p><ol xss=removed><li xss=removed><strong xss=removed>Official Notification:</strong> You can search for the official notification of that particular exam, this will provide you all the necessary and correct details about the exam. If the official notification is still not out then you can search for some previous year <a href=\"https://blog.madeeasy.in/gate-ese-ies-psu-gov-job-notifications\" target=\"_blank\" rel=\"noopener\" xss=removed>notification</a>. Even if you are looking at some other source for knowing about the exam, you still must go through the official notification as it will provide you the exact and updated data about that particular exam.</li><li xss=removed><strong xss=removed>Blogs:</strong> There are various blogs that are available online related to the many <strong xss=removed>government exams</strong> conducted in India. All you have to do is search for the exam online and you will get a number of blogs on the particular exam. Read some blogs and you will know how the particular exam is conducted, what post is it for and what are the future prospects after cracking the exam.</li><li xss=removed><strong xss=removed>Videos:</strong> With the coming of YouTube, <a href=\"https://www.madeeasy.in/home/video?utm_source=Blog\" target=\"_blank\" rel=\"noopener\" xss=removed>video</a> too has gained a lot of traction among the people and when you search for the exam on Google, it will also show you some videos related to the same. So if you are not the reading type of person than even these videos can help you in providing all the knowledge which is necessary for cracking that particular exam.</li><li xss=removed><strong xss=removed>Toppers Talk:</strong> What better to know about something than from the horse’s mouth. After the exam results are out, the toppers are called for interviews where they discuss all about the exam. You can also watch these <strong xss=removed><a href=\"https://www.madeeasy.in/home/achievement?utm_source=Blog\" target=\"_blank\" rel=\"noopener\" xss=removed>toppers talk</a></strong> or read their interviews in order to get complete details about the particular competitive exam.</li></ol>','Upcoming-Government-Exams-2020-embibe.png',1,1,NULL,NULL,NULL,NULL,'2020-08-27 08:01:11','2020-08-27 08:01:11'),
	(17,5,'Have a Plan','have-a-plan','<p xss=removed>Once you are aware of the basic know how of the exam, the second step is to have a plan. A <a href=\"https://blog.madeeasy.in/set-realistic-goals-exam\" target=\"_blank\" rel=\"noopener\" xss=removed>goal</a> without a plan is just a wish and wishes do not always come true. So form a plan, make a strategy and start your preparation.  Ensure that you incorporate all the stages of the exam in your strategy. You strategy must include:</p><ol xss=removed><li xss=removed>The subjects you have to study</li><li xss=removed>Necessary breaks like tea, meals, daily chores, sleep etc.</li><li xss=removed>Revision time</li><li xss=removed>Practise papers that you need to solve</li><li xss=removed>Class timings if you are taking coaching or are in college</li><li xss=removed>Job timings if you are working</li><li xss=removed>Travel timings if any</li></ol><p xss=removed>Incorporating all the above points you need to formulate an effective strategy which is strict yet flexible to make any changes. You can check how you can make <a href=\"https://blog.madeeasy.in/gate-preparation-tips-right-time-right-strategy-prepare-gate-exam\" target=\"_blank\" rel=\"noopener\" xss=removed>effective strategies</a> here.</p>','government-jobs-mobile.jpg',1,2,NULL,NULL,NULL,NULL,'2020-08-27 08:03:22','2020-08-27 08:03:22'),
	(18,5,'Be regular with the news:','be-regular-with-the-news','<p xss=removed>If you are preparing for government exams, it is with no doubt that you will be tested on your current affairs and what is going on around the world. SO the one effective tip for the exam is to be regular with the news. With the digital age there are various means through which you can get your daily news:</p><p xss=removed> You can either buy a good newspaper like ‘The Hindu’ or ‘Indian Express’ and read it in your free time.</p><p xss=removed>You can download the newspaper app and get your daily news right on your phone as and when they happen.</p><p xss=removed>You can browse through the news websites and get your daily dose of news.</p><p xss=removed>During your free time, you can watch the news on television and listen to various debates which will help you too in understanding a particular issue in depth. Some good channels which one must watch are Lok Sabha TV.</p><p xss=removed>You can listen to the radio. There are various radio shows which actually call various renowned panelists to discuss the top news that are a matter of grave concern both nationally and internationally. Some great shows are All India Radio Shows.</p><p xss=removed><strong xss=removed>Coaching Material:</strong> Most of the coaching institutes which provide consulting and classes for the government exams release their monthly <strong xss=removed><a href=\"https://madeeasypublications.org/books/current-affairs-2020-books/23?utm_source=Blog\" target=\"_blank\" rel=\"noopener\" xss=removed>current affairs magazine</a></strong> which summarizes all the monthly news which will really be of great help to you. Apart from monthly they also release yearly magazines.</p><p xss=removed>While you are watching the news do not forget to make notes of the news that you are reading or listening to. The notes will help you in the revision when you are going for the final exam. You should not just read the news but try to get into the intricate details of the same. You must know the history of it, how it will affect India and the world and what are the pros and cons of each side. Thus, being regular with the news will bring you a step closer to clearing the competitive exam.</p>','download_(1).jpeg',1,3,NULL,NULL,NULL,NULL,'2020-08-27 08:04:28','2020-08-27 08:04:28'),
	(19,5,'Create Memory Tricks','create-memory-tricks','<ol start=\"4\" xss=removed><li xss=removed>Learning the government exam is not easy and one really needs a strong memory to remember everything. Thus, one needs memory tricks to remember it all and translate the same in your exam. Some memory tricks required are:</li></ol><ul xss=removed><li xss=removed><strong xss=removed>Memory Palace:</strong> One important trait that will help you in clearing the exam is creating a memory palace. So in order to make your memory sharp whenever you are reading something in order to remember it properly a memory palace helps a lot. A Memory Palace basically is an imaginary location in your mind where you can store all the mnemonic images. The most common form of memory palace includes making a journey through a place which you know well, like a building or town. Along that journey, there have to be specific locations that you always visit in the same order.</li></ul><p xss=removed>For a memory palace, remember a place which you are well acquainted too and then while traveling through the place leave little smalls bits of what you are reading here and there. Whenever you want to recall that particular topic all you need to do is revisit that memory palace and recollect all that you had left behind. This way no matter how huge and difficult any topic is you will be able to remember it by heart.</p><ul xss=removed><li xss=removed><strong xss=removed>Mnemonics</strong>: A mnemonic is a learning technique that aids information retention or retrieval in human memory. In Mnemonics, one makes use of elaborative encoding, retrieval cues, and imagery as specific tools to encode any given important information that one is trying to remember in a way that allows for efficient storage and retrieval. So whatever you are trying to remember make mnemonics of the same and it will help you in recalling all the information in the exam time.</li></ul>','List-of-Government-Exams-After-Graduation.jpg',1,4,NULL,NULL,NULL,NULL,'2020-08-27 08:06:01','2020-08-27 08:06:01'),
	(20,5,'Prepare for Aptitude test','prepare-for-aptitude-test','<p xss=removed>Most of the government tests the candidates’ knowledge of their niche subject along with their aptitude. It is one of the core subjects in almost all <strong xss=removed>government competitive exams</strong>. The aptitude helps in judging how smart the candidates are in solving the general problems and their ability to perform specific jobs under certain given situations. So while preparing for the government exam make sure you are also paying attention to the aptitude questions. These aptitude questions play a vital role in clearing your exam and make you stand out among the general crowd.</p><p xss=removed>Though no prior training or special knowledge is required for the aptitude test, practise is necessary to remember the important formulae during the exam. The aptitude test can either be prepared through various online portals or you can also purchase books from the market which are specifically exam based on generic ones. These tests are aimed to test the candidates logical reasoning and thinking performance without prior knowledge or training.    </p>','download_(2).jpeg',1,5,NULL,NULL,NULL,NULL,'2020-08-27 08:06:57','2020-08-27 08:06:57'),
	(21,5,'Solve Past Year Papers','solve-past-year-papers','<p xss=removed>Past year papers are like the key tip in getting success in the government jobs. These are like the practise paper which gives you an idea about the type of exam, marks allotment and the questions that will be asked in the same. While most of the students will agree with us on this suggestion, many still forget to go through the past year papers before the exam. There is also a strong perception that by going through the previous years’ question papers, it becomes easy for the candidate to figure out the common questions.</p><p xss=removed>While solving the previous year papers use an effective technique by creating examination hall atmosphere and then solving the paper in the stipulated time. It has been noticed that maximum students fail in the exams due to lack of time which results in them solving the paper in a haphazard condition. Rephrasing the previous year papers a number of times before you appear for the final exam will develop your <a href=\"https://blog.madeeasy.in/time-boxing-effective-time-management-tool-students\" target=\"_blank\" rel=\"noopener\" xss=removed>time</a></p>','Tips-to-Clear-Government-Exams-800x445.jpg',1,5,NULL,NULL,NULL,NULL,'2020-08-27 08:08:39','2020-08-27 08:08:39'),
	(22,5,'Make notes','make-notes','<p xss=removed>Whether you are going digital or <strong xss=removed><a href=\"https://blog.madeeasy.in/art-note-making\" target=\"_blank\" rel=\"noopener\" xss=removed>traditional note making</a></strong> is an art that one master it in order to get success in the government exams. There are various online tools that are available for notes like Evernote, however you will have to decide if you want to make online notes or offline based on the type of exam you are appearing for. If your exam is offline then you must make offline notes however if the exam is online, digital notes will also help.</p><p xss=removed>So make notes of what you read as that will help you in remembering what you read and later help in revising your syllabus just before the exam.    </p>','download_(3).jpeg',1,6,NULL,NULL,NULL,NULL,'2020-08-27 08:10:39','2020-08-27 08:10:39'),
	(23,5,'Stay fit and healthy','stay-fit-and-healthy','<p xss=removed>Most of the students have this notion that only focusing on the studies and sacrificing the rest will bring them success. Well, this is not true at all. While studies are important, what is equally important is your diet and fitness. A nutritious diet ensures that both your mind and body have enough energy to go through the day enduring the stress and fatigue that comes with preparation and practise sessions. So eating well is important.</p><p xss=removed>Equally important is to invest time in staying fit as it helps clear your mind and stay focusses. Exercise regulates the flow of blood and oxygen to your mind, which results in a better attention span, learning, and retention. All study and no play makes one dull so it is important to include recreational activities in your daily routine. You must also include necessary breaks that will help in rejuvenating your energy and sitting back to study.</p><p xss=removed>Staying fit and healthy ensures that your hard work and dedication pays well and is not wasted.        </p>','Making-Effective-Notes.jpg',1,6,NULL,NULL,NULL,NULL,'2020-08-27 08:12:32','2020-08-27 08:12:32'),
	(24,5,'Prepare for All The Stages','prepare-for-all-the-stages','<p xss=removed><strong xss=removed>Most of the government exams are a two-stage process:</strong> a written exam followed by an interview. So no matter which exam you are preparing for make sure you are firstly aware of the number of stages and their respective syllabus and that you are preparing for them simultaneously. Do not just prepare for the first stage and then wait for the results then start with the second stage preparation. Before you know it may be too late for the preparation. Thus, prepare for all the stages and keep yourself ready for the exam as a whole.</p><p xss=removed>As soon as the first stage is over you must start focusing on the second one and so on. For the interview too you must get guidance from experts and take some mock interviews so that you are prepared well and nothing comes as a shock to you.    </p>','tpaq2emh-cat-exam.jpg',1,7,NULL,NULL,NULL,NULL,'2020-08-27 08:14:08','2020-08-27 08:14:08'),
	(25,5,'Remain positive','remain-positive','<p xss=removed>Motivation and positivity are the key driving force of success in life. So no matter whether you fail or succeed in the first attempt it is necessary to stay motivated and confident about yourself and your abilities. While confidence is necessary overconfidence can backfire you very badly. So you must make sure that neither failure drops your confidence, not good performance makes you overconfident, just keep accessing yourself and always stay confident.</p><p xss=removed>Some ways of staying positive are meditation, exercise, reading success stories and watching <a href=\"https://www.youtube.com/watch?v=kj8OdkNHNEM&list=PL85IluG5Tb9piwC5EXuP6L6RUDC9XgHQV\" target=\"_blank\" rel=\"noopener\" xss=removed>good motivation videos</a>. These activities help keep you optimistic and dedicated which are a must for any government exam.</p><p xss=removed>Success is a science if you have the conditions you get the results. So there is a possibility that some things might not be in your favour which may lead to failure but all you need to do is wait for your moment and stay in the game. The competitive exams require deep conceptual clarity of the subjects. Mere speculations and half-hearted efforts will never bring you success rigorous hard work and tireless endeavour is required. Following the above steps will help you instil a good learning habit, the results of which would be highly encouraging.</p><p xss=removed>We hope these tips help you in getting success in the exam that you are preparing for and brings you a lot of good wishes and a great life ahead. Until then we wish you all the luck for your preparation, keep studying and stay fit and health.</p>','exam.jpg',1,5,NULL,NULL,NULL,NULL,'2020-08-27 08:15:12','2020-08-27 08:15:12'),
	(26,6,'University of Bologna','university-of-bologna','<p xss=removed><span xss=removed>Location: </span><a href=\"https://www.topuniversities.com/where-to-study/europe/italy/guide\" xss=removed>Italy</a></p><p xss=removed><span xss=removed>Established in:</span> 1088</p><p xss=removed>The ‘Nourishing Mother of the Studies’ according to its Latin motto, the University of Bologna<span xss=removed> </span>was founded in 1088 and, having never been out of operation, holds the title of the oldest university in the world. Until relatively modern times, the university only taught doctorate studies, but today it has a diverse range of programs at all levels.</p><p xss=removed>Located in Bologna, Italy, it has an enrolment of around 87,760 students, of which 6,400 are international students. Famous alumni include three popes, numerous businessmen and several Italian politicians. The University of Bologna is ranked 160<span xss=removed>th</span> in the <a href=\"https://www.topuniversities.com/university-rankings/world-university-rankings/2021\" xss=removed><span xss=removed>QS World University Rankings® 2021</span></a>.</p>','university-of-bologna_0.jpg',0,1,NULL,NULL,NULL,NULL,'2020-08-27 08:18:53','2020-08-27 08:18:53'),
	(27,6,'University Canada West','university-canada-west','<h2 class=\"pane-title\" xss=removed>ABOUT UNIVERSITY CANADA WEST</h2><div class=\"pane-content\" xss=removed><div class=\"field field-name-body field-type-text-with-summary field-label-hidden\"><div class=\"field-items\"><div class=\"field-item even\"><div data-js-read-more=\"height-650\" class=\"read-more-processed\" data-readmore=\"\" aria-expanded=\"true\" id=\"rmjs-1\" xss=removed><p xss=removed>UCW is an innovative business and technology-oriented, teaching-focused institution in Canada, offering undergraduate and graduate degrees. The university is a dynamic and growing institution defined by its close connections to the business community and a commitment to outstanding student services.</p><p xss=removed>We create the most innovating, dynamic and practical learning environment for students. Join us and you too could be a part of the world-class learning community we have developed by sharing our excellent education, professional practice and close connections within the business and technology community, thus transforming our students into leadership-ready graduates.</p><p xss=removed> At UCW, we place an emphasis on smaller classes to ensure each student gets the undivided attention that they deserve. Content can become dated quickly, that’s why we design our programs to meet the needs of the market, ensuring you receive the most up-to-date education possible. Due to the added bonus of our professors having industry experience, their teaching will be approached via case studies, including real stories about their time on the job. Our faculty is made up of passionate individuals who have a desire to improve the lives of students with the greatest of weapons – education.</p><p xss=removed>Our flexible program delivery allows students to study online, on-campus or select a combination. With four terms per year, motivated students can complete their degrees faster than at many traditional universities.</p><p xss=removed> </p><p xss=removed><span xss=removed>Our programs:</span></p><p xss=removed><a href=\"https://gus.webosaurus.co.uk/inbound/click?ctID=MjAzMg==\" class=\"processed\" data-mz=\"\" xss=removed><span xss=removed>Master of Business Administration</span></a></p><p xss=removed>This ACBSP-accredited Master of Business Administration (MBA) program from UCW will prepare you for success on a global level. You will learn how to take challenging situations in your stride, apply pragmatic solutions to problems and ultimately drive the success of your organization through intelligent decision-making.</p><p xss=removed>The MBA degree program has been refined to allow you to acquire more specific knowledge and skills in one of three areas by choosing their three elective clusters from one of the following subject areas: marketing, finance or leadership. Our MBA program also includes relevant digital components.</p><p xss=removed>We collaborate with digital leaders such as Salesforce (Trailhead), Tableau and IBM to keep our students updated with upcoming technological trends.</p><p xss=removed>Program Duration:</p><p xss=removed>2 years with the possibility of faster completion for highly motivated students</p><p xss=removed>Program Fee:</p><p xss=removed>Fall (October), Winter (January), Spring (April), Summer (July), $23,400 (Canada & Canada PRs), $35,100 (International)</p><p xss=removed><span xss=removed> </span></p><p xss=removed><a href=\"https://gus.webosaurus.co.uk/inbound/click?ctID=MjAzMg==\" class=\"processed\" data-mz=\"\" xss=removed><span xss=removed>Associate of Arts</span></a></p><p xss=removed>The Associate of Arts (AA) degree provides you with a broad foundation of knowledge. This 60-credit (20 course) program prepares you for additional post-secondary education or to enter the workforce. The AA degree is accepted for transfer into bachelor degree programs at University Canada West (UCW) and all British Columbia degree-granting institutions provided other admission requirements are met.</p><p xss=removed><em>Graduates of the AA program will develop these skills:</em></p><ul xss=removed><li>Critical thinking and problem solving</li><li>Effective written and oral communications</li><li>Ability to work collaboratively</li><li>Application of theoretical understanding to practice</li><li>Research and evaluative skills</li><li>Mathematical and scientific reasoning</li><li>Analysis, synthesis and integration of knowledge</li><li>Advanced reading comprehension</li></ul><p xss=removed><em>Program Duration:</em></p><p xss=removed>2 years with a possibility of faster completion for highly motivated students</p><p xss=removed><em>Program Fee:</em></p><p xss=removed>Fall (October), Winter (January), Spring (April), Summer (July), $13,920 (Canada & Canada PRs), $34,800 (International)</p><p xss=removed> </p><p xss=removed><a href=\"https://gus.webosaurus.co.uk/inbound/click?ctID=MjAzMg==\" class=\"processed\" data-mz=\"\" xss=removed><span xss=removed>Bachelor of Commerce</span></a></p><p xss=removed>The Bachelor of Commerce (BCom) will provide you with a broad foundation knowledge of contemporary business and its practices. Based in Vancouver, Canada, this ACBSP-accredited degree prepares you for a successful career in business or management, where you will contribute constructively to a global economy.</p><p xss=removed><em>Graduates of the BCom program will:</em></p><ul xss=removed><li>Have a comprehensive understanding of contemporary business practices across all areas of business management</li><li>Know how to conduct business in a multicultural environment, spanning international borders and working cross-culturally</li><li>Have the ability to use interdisciplinary approaches to solve problems and create new business opportunities</li><li>Be able to use critical thinking to analyze and interpret information to make informed decisions </li></ul><p xss=removed><em>Program Duration:</em></p><p xss=removed>4 years with a possibility of faster completion for highly motivated students</p><p xss=removed><em>Program Fee:</em></p><p xss=removed>Fall (October), Winter (January), Spring (April), Summer (July), $27,840 (Canada & Canada PRs), $69,600 (International)</p><p xss=removed> </p><p xss=removed><a href=\"https://gus.webosaurus.co.uk/inbound/click?ctID=MjAzMg==\" class=\"processed\" data-mz=\"\" xss=removed><span xss=removed>Bachelor of Arts in Business Communication</span></a></p><p xss=removed>The Bachelor of Arts in Business Communication (BA) is an interdisciplinary program that will develop your knowledge of media, cultural studies and business alongside theoretical and practical skills. The communication methods learnt and media training students get throughout this course are relevant to careers in professional writing, journalism, public relations, communications and advertising.</p><p xss=removed><em>Graduates of the BA program will be able to:</em></p><ul xss=removed><li>Learn to evaluate and integrate all types of business communication</li><li>Demonstrate research techniques and methodologies</li><li>Create ethically and legally sound content for a variety of markets</li><li>Integrate media and content to communicate persuasively to specific audiences</li><li>Apply communication methods to business problems and contexts</li></ul><p xss=removed><em>Program Duration:</em></p><p xss=removed>4 years with a possibility of faster completion for highly motivated students</p><p xss=removed><em>Program Fee:</em></p><p xss=removed>Fall (October), Winter (January), Spring (April), Summer (July), $27,840 (Canada & Canada PRs), $69,600 (International)</p><p xss=removed><span xss=removed> </span></p><p xss=removed><a href=\"https://gus.webosaurus.co.uk/inbound/click?ctID=MjAzMg==\" class=\"processed\" data-mz=\"\" xss=removed><span xss=removed>Future career prospects</span>:</a></p><p xss=removed>According to the January 2020 data from the graduates that participated in the study:</p><ul xss=removed><li>100% Graduate Employment within 6 Months </li><li>88% have secured employment within 3 months of graduation</li><li>67% have secured employment within a month of graduation</li></ul><p xss=removed>Our alumni work for some of the world’s leading organizations such as:</p><ul xss=removed><li>Siemens </li><li>Scotiabank </li><li>EmpowerID </li><li>Sigamlux </li><li>Oakville Trading</li><li>Apple </li><li>Telus </li><li>SAP </li><li>GPP </li><li>Nestle </li><li>SoftMoc </li><li>The Marketing</li><li>Kangaroos </li><li>Sanone </li><li>Walt Disney World</li></ul><p xss=removed>Many of the world’s biggest companies have offices within walking distance of our downtown campus, providing you with unparalleled access to a network of prospective employers. </p><p xss=removed><span xss=removed>What makes us different?</span></p><ul xss=removed><li>100% employability for MBA graduates within 6 months</li><li>Business and technology-focused university with an emphasis on practical experience</li><li>Downtown location, state of the art new campus opening Fall 2020</li><li>ACBSP-accredited MBA and Bachelor of Commerce program.</li><li>Teaching-intensive institution with qualified, expert faculty with real industry experience</li><li>UCW’s learning environment is dynamic and practical. Class sizes are small to focus more on individual requirements.</li><li>You are given the opportunity to study in the heart of Vancouver’s vibrant business community.</li></ul></div></div></div></div></div>','University-Canada-West-Special-Targeted-Regional-Awards-for-International-Students-Canada-1024x597.jpg',1,2,NULL,NULL,NULL,NULL,'2020-08-27 08:26:31','2020-08-27 08:26:31'),
	(28,5,'IULM University','iulm-university','<div class=\"panel-pane pane-tabbed-content js-sub-nav-trigger\" xss=removed><div class=\"pane-content\" xss=removed><div class=\"tabbed-content\" xss=removed><div class=\"tabbed-content__tabs\"><div class=\"tabbed-content__panel tabbed-content__panel-0\" xss=removed><p xss=removed>Università IULM is the centre of excellence in Italy for training in Communication and New Media, Languages, Tourism, Arts and Design.</p><p xss=removed>Knowledge, awareness and expertise: for more than 50 years Università IULM has been building its educational mission on these three cornerstones, integrating cultural preparation, soft skills and professional competence.</p><p xss=removed><span xss=removed>Why Università IULM?</span></p><ul xss=removed><li>Università IULM offers innovative training courses, a mix of theory and practice strictly connected to the real world and particularly focused on new job profiles in the fields of corporate communication, marketing, media, interpreting and translation, public relations, cultural events, tourism, arts and design.</li><li>Università IULM courses allow the acquisition of those soft skills that are highly requested in the labour market (teamwork, decision-making, communication).</li><li>Università IULM sets the Student as the core of its mission, taking care of aspects of university life such as the interaction between Student and Faculty, the connection with the real world and the support of collaborative learning and creative thinking. Students proved to value positively this approach, as Università IULM scored # 1 in Italy and # 4 in Europe on the specific area named <em>Engagement </em>(based on students’ satisfaction) and # 201+ in the overall table of “THE Europe Teaching Ranking 2019”. This is a significant starting point considered that it is the first time that Università IULM takes part in this international ranking.</li><li>Università IULM is one of the most active centres for research and higher education in the fields of communication, tourism and languages. The collections of Università IULM Library include more than 240,000 catalogued books, more than 1,300 periodicals and around 56,000 films, documentaries and language courses.</li><li>Università IULM is an inspiring place to study and research. To enrich their academic perspective, Università IULM provides students with Research Centres such as “Behaviour and Brain Lab” Research Centre, the Research Centre in Strategic Communication - CECOMS, Centre for Employee Relations & Communication – CERC, Euresis Center for Diagnosis, Intervention, DSA Research, “IULM AI LAB” and with cutting-edge laboratories including Journalism Lab, a Film/TV production room and sound stage, a multimedia laboratory dedicated to integrated multimedia audio-visual production and a simultaneous interpretation classroom. </li><li>Università IULM allows students to experience “Made in Italy” lifestyle. Università IULM campus is located in Milan, one of the safest and most student-friendly cities in Europe and in the World, a vibrant and dynamic place where students can plan and build their future in a stimulating surrounding, with an insider’s view to craftsmanship, tradition and innovation, which are part of the “Made in Italy” business model.</li><li>Università IULM campus offers unsurpassed facilities for both learning and university life. Surrounded by a flowered garden, it is an attractive place to study as well as an important venue for concerts, exhibitions, conferences, cultural and artistic events thereby making the University a multipurpose cultural centre for the city of Milan.</li><li>Università IULM is promoting sustainable development facing the United Nations 17 Sustainable Development Goals (SDGs): inclusive policies and social engagement, as well as the ten-year commitment to the development of services in support of disability and diversity contribute to rank Università IULM among the top 300 universities in the world in the Impact Rankings 2020 for the SDG no. 10 \"Reducing inequalities\".</li></ul><p xss=removed><span xss=removed>Università IULM at a glance (facts and figures)</span></p><ul xss=removed><li>1968 year of foundation</li><li>5 undergraduate Degree Courses</li></ul><ul xss=removed><li>6 postgraduate 2-year Masters Degrees</li><li>16 postgraduate 1-year Masters Degrees</li></ul><ul xss=removed><li>2 PhD’s programms</li><li>6 Professional Training Courses</li><li>11 Executive Education Courses</li><li>ranked #201-300 in THE Impact Rankings \"Reducing inequalities\" 2020</li><li>ranked #1 in Italy and #4 in Europe for engagement in THE Europe Teaching Ranking 2019</li><li>ranked #201+ in THE Europe Teaching Ranking 2019</li><li>150 partner universities worldwide</li><li>1400 partner companies in research and learning projects</li><li>3 auditoriums</li><li>4 food&beverage outlets</li><li>50000 sqm campus</li><li>240 beds</li></ul></div></div></div></div></div><div class=\"panel-separator\" xss=removed></div><div class=\"panel-pane pane-university-rankings-chart\" xss=removed><h2 class=\"pane-title\" xss=removed>EXPLORE RANKINGS DATA FOR IULM UNIVERSITY</h2><div class=\"pane-content\"><div class=\"ranking-component\"></div><div class=\"d3-ranking-disclaimer\" xss=removed>All ranked institutions have an overall score and 4 pillar scores. However for each pillar, only institutions ranked in the top 500 overall or the top 500 in this pillar have a publicly visible score</div></div></div>','download_(4).jpeg',1,5,NULL,NULL,NULL,NULL,'2020-08-27 08:29:13','2020-08-27 08:29:13'),
	(29,5,'University of Groningen','university-of-groningen','<div class=\"panel-pane pane-tabbed-content js-sub-nav-trigger\" xss=removed><div class=\"pane-content\" xss=removed><div class=\"tabbed-content\" xss=removed><div class=\"tabbed-content__tabs\"><div class=\"tabbed-content__panel tabbed-content__panel-0\" xss=removed><p xss=removed>The University of Groningen was founded in 1614 and has a long tradition of education, innovation, and research. We are consistently ranked among the top 100 universities in the world and have one of the largest international student communities in the Netherlands. In fact, of our 30,000 students, 6,000 are international students from over 120 different nationalities.</p><p xss=removed><span xss=removed>Why Groningen?</span></p><p xss=removed>Highly-regarded degree programmes: the University of Groningen offers over 120 highly regarded, English-taught degree programmes. As a student here, you will receive high-quality supervision, a well-rounded education, and have many options to choose from, including electives, minor programmes, and exchange possibilities. In 2017, the University of Groningen was awarded the <a href=\"https://www.rug.nl/news/2016/11/nine-top-degree-programmes-best-broad-based-general-university?lang=en\" class=\"processed\" data-mz=\"\" xss=removed>\'Best Traditional University in the Netherlands\'</a> quality label from ‘Keuzegids Universiteiten’ (Guide to Dutch Universities).</p><p xss=removed>High-quality research: the University of Groningen is one of the best research universities in Europe. The University carries out ground-breaking research, and in 2016, our very own professor Ben Feringa won the Nobel Prize in Chemistry.</p><p xss=removed>International environment: Almost 6,000 international students study in Groningen, from over 120 different countries. You will share your classroom with people from all around the world, and have the opportunity to go abroad yourself with the exchange partnerships the University has internationally. Several Master programmes at the University of Groningen are in cooperation with other European universities, meaning it is possible to study part of your degree abroad. In addition, the Dutch are among the best non-native English speakers in the world, so the language barrier is not a problem here. However, if you do want to pick up some Dutch while studying here, you can take free Dutch classes provided by the university.</p><p xss=removed>Distinguished reputation for 400 years: During the 400 years that the university has existed, the University of Groningen has built an excellent reputation around the world. The people who have studied or worked at the university include the first president of the European Bank, the first female University student and the first female lecturer in the Netherlands, the first Dutch astronaut, and four Nobel Prize winners.</p><p xss=removed>Lively student life: With the youngest population in the Netherlands and a quarter of the inhabitants being students, Groningen is a fantastic student city. Walking through the city, you can see students everywhere - whether they are enjoying the nightlife, studying in a café or in the library, hanging out with friends in the park, or working a part-time job. Groningen is also a very safe and eco-friendly city to live in, and has been chosen as one of the happiest cities in the whole of Europe.</p></div></div></div></div></div><div class=\"panel-separator\" xss=removed></div><div class=\"panel-pane pane-university-rankings-chart\" xss=removed><h2 class=\"pane-title\" xss=removed>EXPLORE RANKINGS DATA FOR UNIVERSITY OF GRONINGEN</h2></div>','ranking-page.jpg',1,6,NULL,NULL,NULL,NULL,'2020-08-27 08:31:45','2020-08-27 08:31:45'),
	(30,6,'Autonomous University of Baja California','autonomous-university-of-baja-california','<h1 xss=removed>Universidad Autónoma de Baja California</h1><p xss=removed>In UABC we promote a variety of options to help our students experience an integral education with a sense of social responsibility for them to participate intensively in a wide range of growth possibilities, such as: a comprehensive tutoring system, internships linked to public and private sectors, cultural and sports activities, entrepreneurship, knowledge dissemination, and community service. We also encourage our students to learn in other languages, and to have life experiences in different cultures, universities and countries. </p>','download_(5).jpeg',1,5,NULL,NULL,NULL,NULL,'2020-08-27 08:33:41','2020-08-27 08:33:41'),
	(31,6,'University of Salamanca','university-of-salamanca','<div id=\"overview-section\" class=\"\" xss=removed><div class=\"tab-content\" xss=removed><div class=\"about tab-pane active\" id=\"tab-1\" xss=removed><div class=\"overview-content\" xss=removed><div class=\"details\" xss=removed><div class=\"field-profile-overview\" xss=removed>Alfonso IX of León wanted to have higher studies in his kingdom and therefore created in 1218 the \'Salamanticae scholas\', germ of the current University of Salamanca that now celebrates 800 years of uninterrupted history creating, promoting and disseminating knowledge. Thus, the University of Salamanca became, along with Paris, Oxford and Bologna in one of the first European universities and today is the only Spanish university that has maintained its activity over the centuries.<br>The University of Salamanca will go through a time of unprecedented expansion with the creation of the first American universities, which from 1551 begin to be founded following the wake of the Salamanca by using their founding letters as a model. More than 70% of the universities created in the sixteenth and seventeenth centuries now consider the University of Salamanca their \'alma mater\'.<br>The University of Salamanca has an important material heritage in the form of historic buildings and emblematic spaces that are still active and receive the visit of hundreds of people every day. Especially noteworthy is the Main School Building with its Plateresque façade, inside which stands the Historical General Library with 2,774 manuscripts, 483 incunabula and around 62,000 volumes printed between the 16th and 18th centuries.<br>The science and technology developed at the University of Salamanca have led some of the most important advances of recent centuries. From the Salamanca studio came personalities such as Torres Villarroel and Abraham Zacut. The advanced thinking of Francisco de Vitoria has made Salamanca the cradle of International Law, but other illustrious figures have passed through its classrooms, such as Fray Luis de León or Francisco de Salinas or Antonio de Nebrija, creator of the first grammar of Spanish. In more recent times, the University has welcomed great thinkers and statesmen like Miguel de Unamuno, Enrique Iglesias, Jacques Delors or Adolfo Suárez.<br>At present, the University of Salamanca continues to maintain its great capacity for attraction and has a stable student population of around 30,000 students. Account to serve you with nine campuses distributed between Salamanca, Ávila, Zamora, Béjar and Villamayor among which are distributed the 26 faculties and colleges and the 12 research centers. Another of the distinctive features of the University is the teaching of Spanish that attracts thousands of foreign students in different educational programs.<br>From the International Courses Society the Diplomas of Spanish as a Foreign Language (DELE) have been developed for years and, recently, an agreement signed with the Cervantes Institute, the National Autonomous University of Mexico and the University of Buenos Aires, has made the University of Salamanca leads, along with them, the development of the first digital certificate of Spanish (SIELE) that can be done from anywhere in the world and will carry the certification of the study of Salamanca as a guarantee of its validity.</div><span class=\"read-less\" xss=removed><a href=\"https://www.topuniversities.com/universities/university-salamanca#\" class=\"less-link\" xss=removed></a></span></div></div></div></div></div><div class=\"record dfp-ad content-ad\" xss=removed><div id=\"dfp-ad-university_profile_leaderboard_728_x_90-wrapper\" class=\"dfp-tag-wrapper\" xss=removed><div id=\"dfp-ad-university_profile_leaderboard_728_x_90\" class=\"dfp-tag-wrapper ad-loaded\" data-google-query-id=\"CK6v3JqCu-sCFdZ_fQoduBUOrw\" xss=removed></div></div></div>','garden-of-eden-e1517485465230.jpg',1,2,NULL,NULL,NULL,NULL,'2020-08-27 08:59:35','2020-08-27 08:59:35'),
	(32,2,'ASDFASD jjjj','asdfasd-jjjj','<p>asdfasdfasdfasdfasdfasdfasdfasdfasdfasdfasdfasdfasdfasdfasdfasdfasdfasdfasdfasdf</p>','autom.jpeg',0,2,NULL,0,'asd','askdds','2020-09-12 14:57:01','2020-09-12 14:59:10');
