	(14,'govt. exam','govt-exam','','Most of the specialized fields in civil services in India belong to the central services. The Central Civil Services are classified into Group A and Group B, both of which are gazetted.\r\n\r\nIn 2015, the Government of India approved the formation of Indian Skill Development Service.[1][2] Further, in 2016, the Government of India approved the formation of Indian Enterprise Development Service.[3]',1,'fab fa-goodreads-g','tpaq2emh-cat-exam.png',1,0,'2020-05-13 07:42:00','2020-09-03 06:19:21'),
	(15,'medical entrance','medical-entrance','','The All India Pre-Medical test/ Pre-Dental Entrance Test (AIPMT is now replaced by NEET-UG)[1] was an annual medical entrance examination in India.[2] The exam was conducted by the Central Board of Secondary Education (CBSE) but is now conducted by NTA ( National Testing Agency), Delhi for admission to MBBS and BDS courses in several medical colleges across the country. 15% of the total seats in all medical and dental colleges run by the Union of India, state governments, municipal or other local authorities in India, except in the states of Andhra Pradesh, Telangana and Jammu and Kashmir, were reserved for candidates who qualified this examination.',1,'fas fa-briefcase-medical','download.jpeg',1,0,'2020-05-13 08:03:07','2020-09-03 06:19:19'),
	(16,'engineering entrance','engineering-entrance','','Two major engineering entrance examinations are used for admission to engineering institutes across India, Indian Institute of Technology Joint Entrance Examination (IIT-JEE) and All India Engineering Entrance Examination (AIEEE).',1,'fas fa-assistive-listening-systems','indian-student-taking-class-college-high-school_eae08dc0-8892-11e7-a194-d8b7abb7611c.jpg',1,0,'2020-05-13 08:05:59','2020-09-03 06:19:19'),
	(17,'civil services','civil-services','','The Civil Services refer to the career bureaucrats who are the permanent executive branch of the Republic of India. The civil service system is the backbone of the administrative machinery of the country.[1][2]\r\n\r\nIn India\'s parliamentary democracy, The ultimate responsibility for running the administration rests with the people\'s elected representatives—cabinet ministers. But a handful of ministers cannot be expected to deal personally with the manifold problems of modern administration. Thus the ministers lay down the policy and it is for the civil servants, who serve at the pleasure of the President of India, to carry it out. However, Article 311 of the constitution protects them from politically motivated or vindictive action.\r\n\r\nCivil servants are employees of the Government of India or of the states, but not all employees of the Government are civil servants. As of 2010, there were 6.4 million government employees in India but fewer than 50,000 civil servants to administer them.[3]\r\n\r\nCivil servants in a personal capacity are paid from the Civil List. Senior civil servants may be called to account by Parliament. The civil service system in India is rank-based and does not follow the tenets of the position-based civil services.[2]\r\n\r\nThe Government of India has also approved the formation of two new cadres of civil servants: the Indian Skill Development Service (2015)[4][5] and the Indian Enterprise Development Service (2016).[6]',1,'fab fa-servicestack','The-Indian-Administrative-Service-IAS-1024x724.jpg',1,0,'2020-05-13 08:09:05','2020-09-03 06:19:18'),
	(18,'computer programing','computer-programing','','Computer programming is the process of designing and building an executable computer program to accomplish a specific computing result. Programming involves tasks such as: analysis, generating algorithms, profiling algorithms\' accuracy and resource consumption, and the implementation of algorithms in a chosen programming language (commonly referred to as coding).[1][2] The source code of a program is written in one or more languages that are intelligible to programmers, rather than machine code, which is directly executed by the central processing unit. The purpose of programming is to find a sequence of instructions that will automate the performance of a task (which can be as complex as an operating system) on a computer, often for solving a given problem. The process of programming thus often requires expertise in several different subjects, including knowledge of the application domain, specialized algorithms, and formal logic.',1,'fab fa-weebly','images.jpeg',1,0,'2020-05-13 08:12:55','2020-09-04 10:24:06'),
	(19,'bank exam','bank-exam','','A bank is a financial institution that accepts deposits and recurring accounts from the people and creates Demand Deposit.[1] Lending activities can be performed either directly or indirectly through capital markets. Due to their importance in the financial stability of a country, banks are highly regulated in most countries. Most nations have institutionalized a system known as fractional reserve banking under which banks hold liquid assets equal to only a portion of their current liabilities. In addition to other regulations intended to ensure liquidity, banks are generally subject to minimum capital requirements based on an international set of capital standards, known as the Basel Accords.\r\n\r\nBanking in its modern sense evolved in the fourteenth century in the prosperous cities of Renaissance Italy but in many ways was a continuation of ideas and concepts of credit and lending that had their roots in the ancient world. In the history of banking, a number of banking dynasties – notably, the Medicis, the Fuggers, the Welsers, the Berenbergs, and the Rothschilds – have played a central role over many centuries. The oldest existing retail bank is Banca Monte dei Paschi di Siena, while the oldest existing merchant bank is Berenberg Bank.',1,'fas fa-piggy-bank','banks-blockchain-technology.jpg',1,0,'2020-05-13 14:33:37','2020-09-03 04:14:36');
