	(2,'Terms & Condition','terms-condition','<p xss=removed>PLEASE READ THE FOLLOWING CAREFULLY BEFORE ACCESSING AND/OR USING ANY PART OF THE SITE.</p><p xss=removed>Welcome to <a href=\"https://www.top10.com/\">www.top10.com</a> (together with its subdomains, Content and Marks, the “Site”).Please read the following Terms of Use carefully before using this Site so that you are aware of your legal rights and obligations with respect to Natural Intelligence Ltd.(\'NI\', \'we\', \'our\' or \'us\'). By accessing or using the Site, you expressly acknowledge and agree that you are entering a binding legal agreement with us and have understood and agree to comply with, and be legally bound by, these Terms of Use, together with the Privacy Policy that can be accessed by clicking here <a href=\"https://www.naturalint-top10.com/privacy-policy\">https://www.naturalint-top10.com/privacy-policy</a> (the \'Terms\'). You hereby waive any applicable rights to require an original (non-electronic) signature or delivery or retention of non-electronic records, to the extent not prohibited under applicable law. If you do not agree to be bound by these Terms please do not access or use the Site.</p><h2 data-toc-anchor=\"1\" xss=removed>1. Modification.</h2><p xss=removed>We reserve the right, at our discretion, to change these Terms at any time. Such change will be effective ten (10) days following posting of the revised Terms on the Site, and your continued use of the Site thereafter means that you accept those changes.</p><h2 data-toc-anchor=\"2\" xss=removed>2. Ability to Accept Terms.</h2><p xss=removed>The Site is only intended for individuals aged sixteen (16) years or older. If you are under 16 years please do not visit or use the Site.</p><h2 data-toc-anchor=\"3\" xss=removed>3. Site Access.</h2><p xss=removed>During the period in which these Terms are in effect, we hereby grant you permission to visit and use the Site, provided that you comply with these Terms and applicable law.<