ive owners. We reserve all rights not expressly granted in and to the Site and the Content.</p><p xss=removed>5.2. Use of Content. Content on the Site is provided to you for your information and personal use only and may not be used, modified, copied, distributed, transmitted, broadcast, displayed, sold, licensed, de-compiled, reverse engineered, or otherwise exploited for any other purposes whatsoever(including, without limitation, to create derivative works) without our prior written consent. If you download or print a copy of the Content you must retain all copyright and other proprietary notices contained therein.</p><h2 data-toc-anchor=\"6\" xss=removed>6. Third-Party Sources and Content.</h2><h3 xss=removed>6.1. The Site enables you to view, access, link to, and use content from Third Party Sources (defined below) that are not owned or controlled by us (\'Third Party Content\').</h3><p xss=removed>The Site may also enable you to communicate and interact with Third Party Sources.\'Third Party Source(s)\' means: (i) third party websites and services; and (ii) our partners and customers.</p><h3 xss=removed>6.2. We have no control over any Third Party Sources.</h3><p xss=removed>We do not assume any responsibility for the content, terms of use, privacy policies, actions or practices of, any Third Party Sources. Please read the terms of use and privacy policy of any Third Party Source that you interact with before you engage in any such activity.</p><h3 xss=removed>6.3. We are not responsible for, and we expressly disclaim all warranties regarding, the accuracy, appropriateness, usefulness, safety, or Intellectual Property Rights (defined below) of, or relating to, any Third Party Content.</h3><h3 xss=removed>6.4. By using the Site you may be exposed to Third Party Content that is inaccurate, offensive, indecent, or objectionable.</h3><p xss=removed>You always have the choice of deciding whether or not to interact with a Third Party Source or to view and use Third Party Content. Your interaction with a Third Party Source and your use of, and reliance upon, any Third Party Content is at your sole discretion and risk.</p><h3 xss=removed>6.5. You are solely responsible and liable for your interaction with a Third Party Source.</h3><p xss=removed>You agree to waive, and hereby do waive, any legal or equitable rights or remedies you may have against NI, and release NI from any and all liability, arising from your use of and interaction on any Third Party Content and from your interaction with any Third Party Source. If you have any queries or complaints regarding a Third Party Source or any Third Party Content, you agree to contact the Third Party Source directly.</p><h2 data-toc-anchor=\"7\" xss=removed>7. User Submissions.</h2><h3 xss=removed>7.1. Responsibility.</h3><p xss=removed>The Site may permit the submission, hosting, sharing and publishing of Content by you and other users (\'User Submissions\'). You understand that whether or not such User Submissions are published, we do not guarantee any confidentiality with respect to any User Submissions. You shall be solely responsible for your User Submissions and the consequences of posting, publishing or uploading them. We have complete discretion whether to publish your User Submissions and we reserve the right in our sole discretion and without further notice to you, to monitor, censor, edit, remove, delete, and/or remove any and all Content posted on the Site (including User Submissions) at any time and for any reason.</p><h3 xss=removed>7.2. Ownership.</h3><p xss=removed>You represent and warrant that you own or have the necessary rights and permissions to use and authorize the Site to use all Intellectual Property Rights (defined below) in and to your User Submissions and to enable inclusion and use thereof as contemplated by the Site and these Terms. Unless the User Submissions are separately referred to, all references herein to Content shall include references to User Submissions. \"Intellectual Property Rights\" means any and all rights, titles, and interests, whether foreign or domestic, in and to any and all trade secrets, patents, copyrights, service marks, trademarks, know-how, or similar intellectual property rights, as well as any and all moral rights, rights of privacy, publicity and similar rights of any type under the laws or regulations of any governmental, regulatory, or judicial authority, foreign or domestic. You retain all of your ownership rights in and to your User Submissions.</p><h3 xss=removed>7.3. License to User Submissions.</h3><p xss=removed>By submitting the User Submissions to NI, you hereby grant NI a worldwide, irrevocable, non-exclusive, royalty-free, perpetual, sub-licensable and transferable license to use, reproduce, distribute, prepare derivative works of display, and perform the User Submissions in connection with the Site and NI business, including without limitation for redistributing part or all of your User Submissions (and derivative works thereof)in any media formats and through any media channels and, and you hereby waive any moral rights in your User Submissions, to the extent permitted by law. You also hereby grant each user of the Site or other viewer or user of the User Submission a non-exclusive right to use, reproduce, distribute, prepare derivative works of, display and perform such User Submissions, all in accordance with these Terms.</p><h3 xss=removed>7.4. Prohibited Content.</h3><p xss=removed>You agree that you will not display, post, submit, publish, upload or transmit a User Submission that: (i) is unfair or deceptive under the consumer protection laws of any jurisdiction; (ii) is copyrighted, protected by trade secret or otherwise subject to third party proprietary rights, including privacy and publicity rights, unless you are the owner of such rights; (iii) creates a risk to a person’s safety or health, creates a risk to public safety or health, compromises national security