s, and agents, from and against any and all claims, damages, obligations, losses, liabilities, costs and expenses(including but not limited to attorney\'s fees) arising from: (i) your use of, or inability to use, the Site; (ii) your User Submissions; (iii) your interaction with any Site user; or (iv) your violation of these Terms.</p><h2 data-toc-anchor=\"16\" xss=removed>16. Term and Termination.</h2><p xss=removed>These Terms are effective until terminated by NI or you. NI, in its sole discretion, has the right to terminate these Terms and/or your access to the Site, or any part thereof, immediately at any time and with or without cause (including, without any limitation, for a breach of these Terms). NI shall not be liable to you or any third party for termination of the Site, or any part thereof. If you object to any term or condition of these Terms, or any subsequent modifications thereto, or become dissatisfied with the Site in any way, your only recourse is to immediately discontinue use of the Site. Upon termination of these Terms, you shall cease all use of the Site. This Section ?15 and Sections ?5 (Intellectual Property Rights), ?7.3 (License to User Submissions), ?11 (Privacy), ?12 (Warranty Disclaimers), ?13 (Limitation of Liability), ?14 (Indemnity), and ?16 (Independent Contractors) to ?18 (General) shall survive termination of these Terms.</p><h2 data-toc-anchor=\"17\" xss=removed>17. Independent Contractors.</h2><p xss=removed>You and NI are independent contractors. Nothing in these Terms creates a partnership, joint venture, agency, or employment relationship between you and NI. You must not under any circumstances make, or undertake, any warranties, representations, commitments or obligations on behalf of NI.</p><h2 data-toc-anchor=\"18\" xss=removed>18. Assignment.</h2><p xss=removed>These Terms, and any rights and licenses granted hereunder, may not be transferred or assigned by you but may be assigned by NI without restriction or notification to you.</p><h2 data-toc-anchor=\"19\" xss=removed>19. General.</h2><p xss=removed>NI reserves the right to discontinue or modify any aspect of the Site at any time. These Terms and the relationship between you and NI shall be governed by and construed in accordance with the laws of the State of Israel, without regard to its principles of conflict of laws. You agree to submit to the personal and exclusive jurisdiction of the courts located in Tel Aviv-Jaffa and waive any jurisdictional, venue, or inconvenient forum objections to such courts provided that NI may seek injunctive relief in any court of competent jurisdiction. These Terms shall constitute the entire agreement between you and NI concerning the Site. If any provision of these Terms is deemed invalid by a court of competent jurisdiction, the invalidity of such provision shall not affect the validity of the remaining provisions of these Terms, which shall remain in full force and effect. No waiver of any term of these Terms shall be deemed a further or continuing waiver of such term or any other term, and a party\'s failure to assert any right or provision under these Terms shall not constitute a waiver of such right or provision. YOU AGREE THAT ANY CAUSE OF ACTION THAT YOU MAY HAVE ARISING OUT OF OR RELATED TO THE SITE MUST COMMENCE WITHIN ONE (1) YEAR AFTER THE CAUSE OF ACTION ACCRUES. OTHERWISE, SUCH CAUSE OF ACTION IS PERMANENTLY BARRED.</p>',0,'15957069559.jpg',NULL,NULL,NULL,'2020-03-23 22:04:24','2020-07-26 01:25:55'),
